import React from 'react'
import './Headline.css'
import Thumbnail from './thumbnail.jpg'

export default class Headline extends React.Component {
  constructor(props) {
    super(props)
  }
  componentDidMount() {
  }
  render() {
    return(
      <div className="newsHeadline">
        <div className="headline">
          <div className="nameSubreddit"><p>{this.props.title.length > 105 ? `${this.props.title.substring(0,105)}...` : this.props.title}</p></div>
          <div className="headlineSubreddit"><p>{this.props.subreddit}</p></div>
        </div>
        <div className="newsThumbnail">{(this.props.thumbnail != 'self' || this.props.thumbnail != 'default') ? <img src={this.props.thumbnail} /> : <Thumbnail />}</div>
      </div>
    )
  }
}
